              "class": {
                "type": "string",
                "description": "The name of the collection (class) from which to delete objects.",
                "example": "City"
              },
              "where": {
                "type": "object",
                "properties": {
                  "operands": {
                    "type": "array",
                    "description": "Combine multiple where filters, requires 'And' or 'Or' operator.",
                    "items": {
                      "$ref": "#/components/schemas/WhereFilter",
                      "has_circular_reference": true
                    }
                  },
                  "operator": {
                    "type": "string",
                    "description": "Operator to use.",
                    "example": "GreaterThanEqual",
                    "enum": [
                      "And",
                      "Or",
                      "Equal",
                      "Like",
                      "NotEqual",
                      "GreaterThan",
                      "GreaterThanEqual",
                      "LessThan",
                      "LessThanEqual",
                      "WithinGeoRange",
                      "IsNull",
                      "ContainsAny",
                      "ContainsAll",
                      "ContainsNone",
                      "Not"
                    ]
                  },
                  "path": {
                    "type": "array",
                    "description": "Path to the property currently being filtered.",
                    "example": [
                      "inCity",
                      "city",
                      "name"
                    ],
                    "items": {
                      "type": "string"
                    }
                  },
                  "valueInt": {
                    "type": "integer",
                    "description": "value as integer",
                    "format": "int64",
                    "nullable": true,
                    "example": 2000
                  },
                  "valueNumber": {
                    "type": "number",
                    "description": "value as number/float",
                    "format": "float64",
                    "nullable": true,
                    "example": 3.14
                  },
                  "valueBoolean": {
                    "type": "boolean",
                    "description": "value as boolean",
                    "nullable": true,
                    "example": false
                  },
                  "valueString": {
                    "type": "string",
                    "description": "value as text (deprecated as of v1.19; alias for valueText)",
                    "nullable": true,
                    "example": "my search term"
                  },
                  "valueText": {
                    "type": "string",
                    "description": "value as text",
                    "nullable": true,
                    "example": "my search term"
                  },
                  "valueDate": {
                    "type": "string",
                    "description": "value as date (as string)",
                    "nullable": true,
                    "example": "TODO"
                  },
                  "valueIntArray": {
                    "type": "array",
                    "description": "value as integer",
                    "nullable": true,
                    "example": "[100, 200]",
                    "items": {
                      "type": "integer",
                      "format": "int64"
                    },
                    "x-omitempty": true
                  },
                  "valueNumberArray": {
                    "type": "array",
                    "description": "value as number/float",
                    "nullable": true,
                    "example": [
                      3.14
                    ],
                    "items": {
                      "type": "number",
                      "format": "float64"
                    },
                    "x-omitempty": true
                  },
                  "valueBooleanArray": {
                    "type": "array",
                    "description": "value as boolean",
                    "nullable": true,
                    "example": [
                      true,
                      false
                    ],
                    "items": {
                      "type": "boolean"
                    },
                    "x-omitempty": true
                  },
                  "valueStringArray": {
                    "type": "array",
                    "description": "value as text (deprecated as of v1.19; alias for valueText)",
                    "nullable": true,
                    "example": [
                      "my search term"
                    ],
                    "items": {
                      "type": "string"
                    },
                    "x-omitempty": true
                  },
                  "valueTextArray": {
                    "type": "array",
                    "description": "value as text",
                    "nullable": true,
                    "example": [
                      "my search term"
                    ],
                    "items": {
                      "type": "string"
                    },
                    "x-omitempty": true
                  },
                  "valueDateArray": {
                    "type": "array",
                    "description": "value as date (as string)",
                    "nullable": true,
                    "example": "TODO",
                    "items": {
                      "type": "string"
                    },
                    "x-omitempty": true
                  },
                  "valueGeoRange": {
                    "type": "object",
                    "properties": {
                      "geoCoordinates": {
                        "type": "object",
                        "properties": {
                          "latitude": {
                            "type": "number",
                            "description": "The latitude of the point on earth in decimal form.",
                            "format": "float",
                            "nullable": true
                          },
                          "longitude": {
                            "type": "number",
                            "description": "The longitude of the point on earth in decimal form.",
                            "format": "float",
                            "nullable": true
                          }
                        }
                      },
                      "distance": {
                        "type": "object",
                        "properties": {
                          "max": {
                            "type": "number",
                            "format": "float64"
                          }
                        }
                      }
                    },
                    "description": "Filter within a distance of a georange."
                  }
                },
                "description": "Filter search results using a where filter."
              }
            },
            "description": "Outlines how to find the objects to be deleted."
          },
          "output": {
            "type": "string",
            "description": "Controls the verbosity of the output, possible values are: `minimal`, `verbose`. Defaults to `minimal`.",
            "default": "minimal"
          },
          "deletionTimeUnixMilli": {
            "type": "integer",
            "description": "Timestamp of deletion in milliseconds since epoch UTC.",
            "format": "int64",
            "nullable": true
          },
          "dryRun": {
            "type": "boolean",
            "description": "If true, the call will show which objects would be matched using the specified filter without deleting any objects. <br/><br/>Depending on the configured verbosity, you will either receive a count of affected objects, or a list of IDs.",
            "default": false
          }
        }
      }
    },
